INSERT INTO `post` VALUES (1,'Hồ Gươm không chỉ là địa điểm du lịch Hà Nội nổi tiếng mà nơi đây còn được các bạn trẻ ưu ái gọi bằng cái tên \"thiên đường hẹn hò\" bởi tới đây vào bất cứ thời điểm nào trong ngày hay bất cứ mùa nào thì cũng có nét lãng mạn và thi vị riêng dành cho các cặp đôi.','2023-12-16 15:28:51','Hồ Gươm và phố đi bộ quanh Hồ Gươm ( Phần 2)',5,'Ăn uống'),(2,'Gieo nằm ẩn mình trong con ngõ nhỏ với bức tường trắng và hàng cây leo phủ xanh. Quán Khá yên tĩnh, bàn ghế với kiểu bài trí độc đáo, mang lại cảm giác như lạc vào khu vườn bí mật, cực kỳ thích hợp cho các buổi tụ tập bạn bè trò chuyện hoặc hẹn hò riêng 2 người.','2023-12-16 16:11:19','Gieo Cafe Phần 1',5,'Ăn uống'),(3,'Xofa Café ','2023-12-18 05:39:29','Xofa Café ',5,'Ăn uống'),(4,'1. Lofita – Quán cà phê tình nhân riêng tư\r\nLofita Coffee có lẽ không còn là cái tên xa lạ đối với các cặp tình nhân. Tại đây có nhiều góc ngồi yên tĩnh và riêng tư cho phép hai người có không gian riêng để trò chuyện, tỏ tình hoặc cầu hôn đầy lãng mạn.\r\n\r\nĐịa chỉ Lofita Coffee: \r\n\r\n– Address 1: 36 Hào Nam, Đống Đa\r\n\r\n– Address 2: 30A Trần Hưng Đạo, Hoàn Kiếm\r\n\r\n– Address 3: 45 Thảo Nguyên, KĐT Eco Park\r\n\r\n– Address 4:  247 Nguyễn Thái Học, TP. Hà Giang\r\n\r\n– Address 5: 261  Nguyễn Cao, Võ Cường,TP. Bắc Ninh \r\n\r\n– Address 6: 225 Trần Quốc Hoàn, Dịch Vọng Hậu, Cầu Giấy \r\n\r\n– Address 7: 30 – 32 Nguyễn Hữu Cảnh, P1. TP. Sa Đéc, Đồng Tháp','2023-12-19 08:20:24','9 quán cà phê tình nhân riêng tư, lãng mạn nhất để hẹn hò',5,'Xem Phim'),(5,'Nếu bạn đang tìm kiếm một quán cafe riêng tư, yên tĩnh để hẹn hò cùng người yêu thì chắc chắn không thể bỏ qua Gardenista Coffee. Đây là quán cà phê tình nhân hiếm hoi tại Hà Nội có nhiều góc riêng kín đáo, riêng tư cho 2 người.','2023-12-19 08:49:17','2. Gardenista Coffee – Quán cà phê tình nhân riêng tư cho cặp đôi',5,'Ăn uống'),(6,'Một quán cafe riêng tư cho cặp đôi tiếp theo mà bạn không nên bỏ qua là Xofa Café & Bistro. Nổi tiếng là quán cà phê “không ngủ” mang phong cách cổ điển đẹp bậc nhất Hà Thành, Xofa dễ dàng trở thành địa điểm hẹn hò được nhiều cặp đôi yêu thích.\r\n\r\n','2023-12-19 08:56:29','3. Xofa Café & Bistro – Quán cà phê tình nhân lãng mạn cho 2 người',5,'Ăn uống'),(7,'Chidori Coffee in Bed cũng là quán cà phê tình nhân có buồng tại Sài Gòn hiếm hoi có rèm riêng tư và kín đáo. Tại mỗi “buồng” cà phê đều được ốp gỗ, che rèm và thiết kế kiểu giường tầng. Trong đó có đầy đủ tiện nghi như ổ cắm, bàn học, đèn làm việc, quạt mini,… tựa như một homestay thực thụ. Vậy nên các cặp đôi có thể chọn Chidori làm chốn hẹn hò lý tưởng, trò chuyện hay thậm chí trao nhau nụ hôn ngọt ngào mà không có rào cản xung quanh. Bên cạnh cà phê và thức uống dễ chịu, Chidori cũng phục vụ cả thức ăn nhẹ để các cặp đôi có giây phút trò chuyện thoải mái hơn.','2023-12-19 14:22:40','4. Chidori Coffee in Bed – Quán cà phê tình nhân có buồng riêng tư',5,'Thư giãn'),(8,'Quán cà phê tình nhân Bancông Cafe & Restaurant có đến 3 tầng, mỗi tầng một concept khác nhau nhưng “tựu chung” trong không gian của tòa biệt thự Pháp cổ. Bên cạnh cà phê, đồ uống và bánh ngọt, Bancông Cafe & Restaurant còn phục vụ những sự kiện quan trọng cho các cặp đôi như tiệc đính hôn, tiệc cưới thân mật, buổi hẹn hò,… vô cùng chỉn chu và chuyên nghiệp. Tỏ tình hay cầu hôn trong không gian ấm cúng, lãng mạn như vậy thì chắc hẳn các nàng sẽ phải “đổ rầm” trước sự chu đáo của các anh ngay thôi!','2023-12-19 14:32:30','7. Bancông Cafe & Restaurant – Quán cà phê tình nhân có không gian riêng',5,'Thư giãn'),(9,'Không cần tổ chức một buổi tiệc cầu hôn hay tỏ tình “hoành tráng”, chàng vẫn có thể khiến nàng “xiêu lòng” đồng ý với một bữa tối ấm cúng, nhẹ nhàng tại quán cà phê tình nhân OZ Coffee House. Bạn cũng có thể thêm các yêu cầu các địa điểm riêng theo ý muốn như phòng riêng, sân vườn, rooftop,… tất cả đều được OZ Coffee đáp ứng. ','2023-12-19 14:49:34','8. OZ Coffee House – Quán cà phê tình nhân có phòng riêng cho 2 người',5,'Ăn uống'),(10,'Bên cạnh concept thiết kế lãng mạn cùng menu đồ uống “có gu”, Aroi Dessert Café còn được các cặp tình nhân vô cùng ưu ái vì mở cửa phục vụ 24/7. Mỗi bàn cà phê được thiết kế hết sức riêng tư, tạo không gian thoải mái để các cặp đôi có thể tâm tình, thậm chí là bạn có thể “kiss” nhẹ môi nàng mà không hề ái ngại bởi những ánh mắt xung quanh. \r\n\r\nĐịa chỉ Aroi Dessert Café: Số 9 Tống Duy Tân, Hàng Bông, Hoàn Kiếm, Hà Nội','2023-12-19 14:51:14','9. Aroi Dessert Café – Quán cà phê tình nhân có vách ngăn ở Hà Nội',5,'Thư giãn'),(11,'Dù sinh sau đẻ muộn nhưng The Seat Cafe nhanh chóng khẳng định tên tuổi và được rất nhiều bạn trẻ yêu thích. Lấy cảm hứng từ những quán cafe đẹp của Hàn Quốc, quán cafe The Seat mang đến cho bạn một không gian quán cực kỳ xinh xắn, ấm cùng chuẩn “Pinterest”. Phong cách thiết kế của quán rất đơn giản với nền tường trắng kết hợp cùng bàn ghế gỗ và nội thất màu be.','2023-12-19 15:03:56','The Seat Cafe (1)',5,'FirstDate'),(12,'Địa chỉ: số 30 An Hòa, phường Mộ Lao, quận Hà Đông, Hà NộiCafe phim Hà Đông là điểm đến hẹn hò Valentine 2023 vô cùng lý tưởng tại Hà Nội. Quán sở hữu không gian với hàng chục phòng chiếu khác nhau, không khi lãng mạn, riêng tư, phù hợp cho những cặp đôi yêu thích sự riêng tư.','2023-12-21 13:13:52','Cafe phim Hà Đông',5,'Xem Phim'),(13,'06:00 : Hướng dẫn viên của công ty du Lịch Nhất Nga sẽ đón khách, khởi hành từ TPHCM lên Đà Lạt, ăn sáng và ăn trưa tại nhà hàng.\r\n\r\n14:00 : tất cả các thành viên sẽ tập trung tại “làng Cù Lần”, ở đây khung cảnh nên thơ và đẹp như tranh vẽ, chúng ta họp mặt với chủ đề “ Hội Ngộ Những Mảnh Ghép Bí Ẩn”.\r\n\r\n- Quý khách di chuyển bằng xe jeep vào làng Cù Lần, sẽ được trải nghiệm cảm giác băng đèo, lội suối với xe vượt địa hình, tạo cảm giác vô cùng hung phấn, chuẩn bị tinh thần cho cuộc giao lưu sắp tới.\r\n\r\n- Quý khách sẽ tham gia những trò chơi nhỏ để giao lưu và làm quen với tất cả các thành viên trong đoàn, chúng ta sẽ hòa nhập và gắn kết thân mật hơn với những người bạn đồng hành của mình.','2024-01-15 20:49:18','THỨ 6 : HỘI NGỘ NHỮNG MẢNH GHÉP BÍ ẨN',5,'Du lịch'),(14,'Địa chỉ: 44B Lý Thường Kiệt, Trần Hưng Đạo, Hoàn Kiếm, Hà Nội\r\nCamelia Lounge đích thực là một quán bar sang chảnh bậc nhất Hà Thành bởi phong cách kiến trúc mang đậm hơi thở Phương Tây. Bạn chắc chắn sẽ bị choáng ngợp bởi sự xoa hoa của những đồ nội thất, sự kết hợp tinh tế của những chiếc đèn chùm lộng lẫy và những mảng tường trầm ấm của gỗ.','2024-01-15 20:51:08','Camelia Lounge',5,'Sôi động'),(15,'Tà Xùa Săn Mây là một trong những cụm từ “hot” nhất thời gian gần đây trong cộng đồng các tín đồ du lịch. Vậy rốt cuộc Tà Xùa có gì đẹp mà khiến dân tình điên đảo đến thế? Và đi Tà Xùa như thế nào, đi vào tháng mấy,..là những thắc mắc của rất nhiều bạn trẻ. Để giải đáp những câu hỏi trên, Vietnam Booking sẽ mang đến cho bạn “tất tần tật kinh nghiệm Săn Mây ở Tà Xùa”. Cùng xem nhé! ','2024-01-16 17:28:24','Tất tần tật kinh nghiệm đi Tà Xùa Săn Mây mới nhất',5,'Du lịch');
